import React from 'react';
import ReactDOM from 'react-dom';
import './Logo.css';

class Logo extends React.Component {
  render() {
    return (
      <div id="logoImage" class="col-12" >
        <img class="img-fluid first col-6 ml-5 mt-4" src="../../../img/newLogo1.png"/>
        <div class="myPic">
          <img class="img-fluid second rounded col-6" src="../../../img/mais.png"/>
        </div>
      </div>
    );
  }
}

export default Logo;
